import React from "react";
import Cards from "../cards/Cards";

export default function Home() {
    function onClose() {
        setCharacters()
    }
    return(
    <div>
    <span>Home</span>
    <Cards characters={props.characters} onClose={props.onClose}/>
    </div>
  );
}
